import "../../components/Dropdown/Dropdown.css";

export default function Dropdown(props:{ characters: any, creators: any, key: any }) {
      return (
        <>
        <select name="selectListCharacters" id="selectListCharacters">
          {props.characters.map((character: any) => {
            return <option key={character.key} value={character.id}>{character.name}</option>;
        })}
       </select>
        <select name="selectListCreators" id="selectListCreators">
          {props.creators.map((creator: any) => {
            return <option key={creator.key} value={creator.id}>{creator.name}</option>;
        })}
       </select>
        </>
      );
    };
